import React from 'react';
import app_logo from './logo/octagon.png'; // Adjust the paths accordingly
import du_logo from './logo/du_logo.png';
import './ProjectCardStyle.css';
import { SocialIcon } from 'react-social-icons'; // Make sure to import SocialIcon from the correct library

const DU_Bus_Tracker = () => {
  const projectData = {
    title: 'DU Bus Tracker',
    description: 'Application Development Lab Project 2-2: "DU BUS TRACKER" – A Bus Community for Dhaka University Students. This app is built with the main purpose of helping students of the University of Dhaka with their need to look up the university buses’ destinations and current positions. We hope that this will serve as a useful tool to navigate through the bus list to find the perfect bus to go from one destination to another. The app features quite a few useful features other than just looking up bus locations and names.',
  };

  const handleMouseEnter = (platform) => {
    // Add logic for mouse enter
  };

  const handleMouseLeave = (platform) => {
    // Add logic for mouse leave
  };

  return (
    <div className="project-card">
      <div className="images-section">
        <div className="image-container">
          <img src={du_logo} alt="Project Image 1" className="project-image" />
        </div>
        <div className="image-container">
          <img src={app_logo} alt="Project Image 2" className="project-image" />
        </div>
      </div>
      <div className="social-links">
        <SocialIcon
          style={{ height: 35, width: 35, cursor: 'pointer' }}
          className="custom-class"
          bgColor="#3b5998"
          url="https://facebook.com/sajjaademon"
          target="_blank"
          onMouseEnter={() => handleMouseEnter('facebook')}
          onMouseLeave={() => handleMouseLeave('facebook')}
        />
        {/* Add another SocialIcon component for the second link */}
        <SocialIcon
          style={{ height: 35, width: 35, cursor: 'pointer' }}
          className="custom-class"
          bgColor="#00acee"
          url="https://twitter.com/example"
          target="_blank"
          onMouseEnter={() => handleMouseEnter('twitter')}
          onMouseLeave={() => handleMouseLeave('twitter')}
        />
      </div>
      <div className="description-section">
        <h3>{projectData.title}</h3>
        <p>{projectData.description}</p>
      </div>
    </div>
  );
};

export default DU_Bus_Tracker;
